// src/trainer/GenerateQuestionBank.js
import React, { useState } from 'react';

const GenerateQuestionBank = () => {
  const [technology, setTechnology] = useState('');
  const [topics, setTopics] = useState('');
  const [numQuestions, setNumQuestions] = useState(0);
  const [difficulty, setDifficulty] = useState(1);

  const handleGenerate = () => {
    // Logic to generate question bank
    alert('Question bank generated!');
  };

  return (
    <div>
      <h1>Generate Question Bank</h1>
      <select onChange={(e) => setTechnology(e.target.value)}>
        <option value="">Select Technology</option>
        <option value="JavaScript">JavaScript</option>
        <option value="Python">Python</option>
      </select>
      <input
        type="text"
        placeholder="Topics"
        value={topics}
        onChange={(e) => setTopics(e.target.value)}
      />
      <input
        type="number"
        placeholder="Number of Questions"
        value={numQuestions}
        onChange={(e) => setNumQuestions(e.target.value)}
      />
      <input
        type="range"
        min="1"
        max="5"
        value={difficulty}
        onChange={(e) => setDifficulty(e.target.value)}
      />
      <button onClick={handleGenerate}>Generate</button>
    </div>
  );
};

export default GenerateQuestionBank;
